import { useState } from "react";

function Nabaso2(){

    const [namee,setName]=useState("");
    const[phonee,setPhone]=useState("");
    const [submitedData,setSubmittedData]=useState([]);

    const onFormSubmit=(event)=>{
        event.preventDefault();
        setSubmittedData([...submitedData,{namee,phonee}]);
        setName('');
        setPhone('');
        
    }




return(
    <>

    <form onSubmit={onFormSubmit}>
    Name <input type="text" name="name" id="id_name" value={namee} onChange={(e)=>e.target.value}/>
    <br />
    
    Phone <input type="number" name="phone" id="id_phone" value={phonee} onChange={(e)=>e.target.value} />
    <br />
    <button type="submit">Submit</button>
    submit
    </form>

    { <li> {submitedData.map((element)=>{element.name})}</li> }

    {submitedData.map((item, index) => ( 
    <li key={index}>
      Name: {item.name}, Phone Number: {item.phone}
    </li>
  ))}
    
    </>
);


}

export default Nabaso2;
